import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import "./StergeConcert";
import StergeConcert from "./StergeConcert";

function ConcertTickets() {
  const [concertData, setConcertData] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    fetchConcertData();
  }, []);

  const fetchConcertData = async () => {
    try {
      const response = await axios.get("http://localhost:3999/site/");
      setConcertData(response.data.concert);
      console.log(response.data.concert);
    } catch (error) {
      console.error(error);
    }
  };

  const handleBileteClick = () => {
    console.log("Bilete button clicked!");
  };

  const modifyClick = () => {
    console.log("modific");
  };

  const deleteClick = async () => {
    try {
      const getIdentificareResponse = await axios.get(
        "http://localhost:3999/site/"
      );
      const numarIdentificare = getIdentificareResponse.data.numarIdentificare;
      console.log(numarIdentificare);
      const response = await axios.delete(
        `http://localhost:3999/site/${numarIdentificare}`
      );
      console.log(response.data);
      setNumarIdentificare("");
      // Redirect to a new path after successful deletion
      window.location.href = "/";
    } catch (error) {
      console.log(error);
    }
  };

  const realizeazaClick = () => {
    navigate("/adauga-concert");
  };

  return (
    <div>
      <section id="concertSection">
        <div className="container">
          <h2>Concerte disponibile</h2>
          <button onClick={realizeazaClick}>Adauga un concert</button>
          {concertData ? (
            concertData.map((concert) => (
              <div key={concert._id}>
                <p>Artist: {concert.nume}</p>
                <p>Bilete disponibile: {concert.bilete}</p>
                <p>Data: {concert.data.slice(0, 10)}</p>
                <p>Locatie: {concert.locatie}</p>
                <button onClick={handleBileteClick}>Bilete</button>
                <button onClick={modifyClick}>Modifica concertul</button>
                <button onClick={deleteClick}>Sterg concertul</button>
                <hr />
              </div>
            ))
          ) : (
            <p>Loading concert data...</p>
          )}
        </div>
      </section>
    </div>
  );
}

export default ConcertTickets;
